    }

    componentDidMount() {
        document.title = "MARS - My Anime Recommendations"
    }

    render() {
        return (
            <div className="App">
                <Header />
                <div className="App-body">
                    <p>
                        We will add stuff here
                    </p>
                </div>
            </div>
        );
    }
}

export default App;
